import express from 'express'
import cors from 'cors'
import axios from 'axios'
import 'dotenv/config'

const PORT = process.env.PORT

const app = express()
app.use(cors())

const baseURL = 'https://ocr-ine.koalavsp.com:444'
/* const baseURL = 'https://api-nb.koalavsp.com:444' */
const username = 'kl_globaltask'
const password = 't59_mSx.25'
const baseImage = {
    "id": "",
    "idReverso": ""
}

app.get('/', async (req, resp) => {
    try {
        const karalundiAuth = 'Basic ' + btoa(username + ':' + password)
        const url = `${baseURL}/ocr/obtener_datos`

        const response = await axios.post(url, baseImage, {
            headers: {
                'Authorization': karalundiAuth,
                'Content-Type': 'application/json'
            }
        })

        resp.json(response.data)

    } catch (error) {
        throw error
    }

})

app.listen(PORT, () => {
    console.log(`Listen in port: ${PORT}`)
})  